import React, { Component } from 'react';

export default class CreateAgreement extends Component {
    constructor(props) {
        super(props);

        this.onChangeAddress = this.onChangeAddress.bind(this);
        this.onChangeLandlord = this.onChangeLandlord.bind(this);
        this.onChangeRent = this.onChangeRent.bind(this);
        this.onChangeTenant = this.onChangeTenant.bind(this);
        this.onChangeLastRentPaid = this.onChangeLastRentPaid.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            tenant: '',
            landlord: '',
            rent: 0,
            address: '',
            lastRentPaid: new Date(),
        }
    }

    componentDidMount() {
        this.setState({
            tenant: 'John Doe',
            landlord: 'Jane Doe',
            rent: 1000,
            address: '1234 Elm St',
            lastRentPaid: new Date()
        })
    }

    onChangeTenant(e) {
        this.setState({
            tenant: e.target.value
        });
    }

    onChangeLandlord(e) {
        this.setState({
            landlord: e.target.value
        });
    }

    onChangeRent(e) {
        this.setState({
            rent: e.target.value
        });
    }

    onChangeAddress(e) {
        this.setState({
            address: e.target.value
        });
    }


    onSubmit(e) {
        e.preventDefault();

        const agreement = {
            tenant: this.state.tenant,
            landlord: this.state.landlord,
            rent: this.state.rent,
            address: this.state.address,
            lastRentPaid: this.state.lastRentPaid
        }

        console.log(agreement);

        window.location = '/';

    }

    render() {
        return (
            <div>
                <h3>Create New Rental Agreement</h3>
                <form onSubmit={this.onSubmit}>
                    <div className="form-group">
                        <label>Tenant: </label>
                        <input type="text"
                            required
                            className="form-control"
                            value={this.state.tenant}
                            onChange={this.onChangeTenant}
                        />
                    </div>
                    <div className="form-group">
                        <label>Landlord: </label>
                        <input type="text"
                            required
                            className="form-control"
                            value={this.state.landlord}
                            onChange={this.onChangeLandlord}
                        />
                    </div>
                    <div className="form-group">
                        <label>Rent: </label>
                        <input type="text"
                            required
                            className="form-control"
                            value={this.state.rent}
                            onChange={this.onChangeRent}
                        />
                    </div>
                    <div className="form-group">
                        <label>Address: </label>
                        <input type="text"
                            required
                            className="form-control"
                            value={this.state.address}
                            onChange={this.onChangeAddress}
                        />
                    </div>
                </form>
            </div>
        );
    }
}
